import React from "react";
import Answer from "../Answer/Answer";

function AnswerBox(props) {
  //if response for question part 1 is not null, then show the other two options
  if (0) {
    return null;
  } else {
    return (
      <div>
        {[0, 1, 2].map((element) => {
          return (
            <Answer
              key={element}
              answer={props.answers[element]}
              responseBank={props.responseBank}
              setResponseBank={props.handleSetResponseBank}
              currentQuestion={props.currentQuestion}
              setCurrentQuestion={props.handleSetCurrentQuestion}
              currentStage={props.currentStage}
              setCurrentStage={props.handleSetCurrentStage}
            />
          );
        })}
        {/* <Answer answer={props.answers[0]} />
        <Answer answer={props.answers[1]} />
        <Answer answer={props.answers[2]} /> */}
      </div>
    );
  }
}

export default AnswerBox;
